import React, { useState, useEffect } from "react";

const ViewProperty = ({ propertyData }) => {
  const [property, setProperty] = useState(null);
  const [photoPreview, setPhotoPreview] = useState(null);

  useEffect(() => {
    if (propertyData) {
      setProperty(propertyData);
      if (propertyData.property_photo) {
        setPhotoPreview(`data:image/jpeg;base64,${propertyData.property_photo}`);
      } else {
        setPhotoPreview(null);
      }
    }
  }, [propertyData]);

  const formatDate = (dateStr) => {
    if (!dateStr) return "";
    return dateStr.split("T")[0];
  };

  const renderFields = () => {
    if (!property) return null;

    const fields = [
      "primary_owner_code","developer_name","building_name","property_type",
      "name","address1","address2","city","state","country","zip_code","municipality_number",
      "electricity_bill_number","water_bill_number","ownership_type","furnishing_status",
      "land_area","carpet_area","builtup_area","bedrooms","bathrooms","washrooms","facing",
      "car_parkings","servant_rooms","balconies","has_dishwasher","has_washing_machine",
      "property_value","year_of_construction","expected_rent_value","status","created_by",
      "creation_date","second_owner_code","mtd_income","ytd_income","mtd_expense","ytd_expense",
      "purchase_value","construction_cost","renovation_cost","registration","transfer_fees","misc_expense"
    ];

    return fields.map((field, idx) => {
      let value = property[field];
      if (value === null || value === undefined) value = "";
      if (field.includes("date") && value) value = formatDate(value);

      return (
        <div key={idx} style={{ display: "flex", flexDirection: "column", minWidth: "180px", marginBottom: "15px" }}>
          <label style={{ fontWeight: "bold", marginBottom: "3px" }}>
            {field.replace(/_/g, " ").toUpperCase()}
          </label>
          <input
            type={field.includes("date") ? "date" : "text"}
            value={value}
            readOnly
            style={{
              padding: "6px",
              borderRadius: "5px",
              border: "1px solid #ccc",
              background: "#f0f0f0",
              width: "100%",
            }}
          />
        </div>
      );
    });
  };

  if (!property) {
    return (
      <div
        style={{
          fontFamily: "Arial, sans-serif",
          padding: "40px",
          textAlign: "center",
          background: "#f5f6fa",
        }}
      >
        <h2>No property data available</h2>
      </div>
    );
  }

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: "20px", background: "#f5f6fa" }}>
      <h2
        style={{
          textAlign: "center",
          background: "#2f3640",
          color: "white",
          padding: "15px 0",
        }}
      >
        View Property
      </h2>

      {/* Property Details */}
      <div
        style={{
          background: "white",
          width: "100%",
          maxWidth: "1500px",
          margin: "0 auto",
          padding: "20px",
          borderRadius: "10px",
          boxShadow: "0 0 10px #ccc",
        }}
      >
        <div style={{ display: "flex", flexWrap: "wrap", gap: "15px" }}>
          {renderFields()}
        </div>

        {/* Photo */}
        <div style={{ textAlign: "center", margin: "20px 0" }}>
          <label style={{ fontWeight: "bold" }}>Property Photo:</label>
          <br />
          {photoPreview ? (
            <img
              src={photoPreview}
              alt="Property"
              style={{
                maxWidth: "200px",
                marginTop: "10px",
                borderRadius: "10px",
                border: "1px solid #ccc",
              }}
            />
          ) : (
            <p>No photo available</p>
          )}
        </div>

        {/* Go Back Button */}
        <div style={{ textAlign: "center", marginTop: "30px" }}>
          <a
            href="/index"
            style={{
              width: 200,
              padding: "10px 20px",
              backgroundColor: "#492bc0ff",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer",
              fontSize: "16px",
              textDecoration: "none",
              display: "inline-block",
            }}
          >
            ‚Üê Go Back Home
          </a>
        </div>
      </div>
    </div>
  );
};

export default ViewProperty;
